package main

import "fmt"

func isSubstring(s string, subString string, startIndex int) bool {

	for i := 0; i < len(subString); i++ {
		if i+startIndex >= len(s) || subString[i] != s[i+startIndex] {
			return false
		}
	}

	return true
}

func canCompleteConcatenation(s string, words []string, index int) bool {
	if len(words) == 0 {
		return true
	}
	visitedWord := make(map[string]bool)
	for i, w := range words {
		if _, found := visitedWord[w]; !found {
			if isSubstring(s, w, index) {
				if canCompleteConcatenation(s, append(append([]string{}, words[0:i]...), words[i+1:]...), index+len(w)) {
					return true
				}
			}
			visitedWord[w] = true
		}
	}

	return false
}

func findSubstring(s string, words []string) []int {
	ans := make([]int, 0)
	for i := 0; i < len(s); i++ {
		if canCompleteConcatenation(s, words, i) {
			ans = append(ans, i)
		}
	}
	return ans
}

